function diffTime() {
  if($data.info.bigtype==='B'){
    $data.info.endtime=$data.info.begintime;
  }
  const { begintime: b, endtime: e } = $data.info
  if (!b || !e) return
  const d1 = $d(b)
  const d2 = $d(e)
  const diffH = d2.diff(d1, 'hour', true)
  const diffD = d2.diff(d1, 'day', true)
  const info = $data.info
  if (diffD < 1) {
    info.leavedays = parseFloat(diffH.toFixed(1))
    info.timetype = 'H'
  } else {
    // info.leavedays = parseFloat(diffD.toFixed(1))
    info.leavedays = (Math.floor(diffH / 24) + Math.min(1, (diffH % 24) / 8)).toFixed(1) * 1.0
    info.timetype = 'D'
  }
}

