    if (!type) return
    const info = $data.info
    info.bigtype = type
    // 在下面开始编写type监听
    if (type === 'Q') {
        info.leavetype = 'S'
        info.leavetypeDesc = '事假'
    } else if (type === 'W') {
        info.leavetype = 'SN'
        info.leavetypeDesc = '市内外出'
        info.isdanger = 'L'
    } else if (type === 'C') {
        info.leavetype = 'CC'
        info.leavetypeDesc = '出差'
        info.isdanger = 'L'
    } else if (type === 'B') {
        info.leavetype = 'BD'
        info.leavetypeDesc = '补打卡'
        info.endtime=info.begintime
        info.leavedays=0
        info.timetype='H'
    }

    $run('clearValidate')
}

